import logo from './café.jpg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <div className="row">
          <p>
            Bom dia
          </p>
        </div>

        <hr/>
        {new Date()}
        <div className="row">
          <label>Não há registros para o dia de hoje</label>
        </div>

        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
